import React from 'react';
import styled from 'styled-components';

const Title = styled.h1`
  color: red;
`;

const Header = styled.nav`
  width: 100%;
  backgroundcolor: red;
  height: 200px;
`;

export default function Index() {
  return <Header></Header>;
}
